How to fix the issue with Java 9 Modularity after adding dependency on mongock?<p>We are developing Spring Boot application that is using MongoDB as storage.
And we want to add to our project the DB migration tool: <a href="https://github.com/cloudyrock/mongock" rel="nofollow noreferrer">mongock</a>.</p>
<p>in <code>pom.xml</code> I added a new dependency:</p>
<pre><code>&lt;dependency&gt;
    &lt;groupId&gt;com.github.cloudyrock.mongock&lt;/groupId&gt;
    &lt;artifactId&gt;mongock-spring&lt;/artifactId&gt;
    &lt;version&gt;3.3.2&lt;/version&gt;
&lt;/dependency&gt;
</code></pre>
<p>And IntelliJ Idea advised me to add the following lines to <code>module-info.java</code>:</p>
<pre><code>requires mongock.spring;
requires mongock.core;
</code></pre>
<p>After that I am not able anymore to build the project, I am getting the following error:</p>
<pre><code>Module 'com.acme.project-name' reads package 'com.github.cloudyrock.mongock' from both 'mongock.spring' and 'mongock.core'
</code></pre>
<p>I do not know a lot about Java 9 Modularity, that why I am stuck with resolving this issue, please advice.</p>

