E11000 (DuplicateKey) error when using a partial multikey unique index<p>Consider a collection with the following documents:</p>
<pre><code>{ 
  name: &quot;John Doe&quot;,
  emails: [
    { 
      value: &quot;some@domain.com&quot;, 
      isValid: true, 
      isPreferred: true 
    }
  ]
},
{ 
  name: &quot;John Doe&quot;,
  emails: [ 
    { 
       value: &quot;john.doe@gmail.com&quot;,
       isValid: false,
       isPreferred: false
    },
    { 
       value: &quot;john.doe@domain.com&quot;,
       isValid: true,
       isPreferred: true
    } 
  ]
}
</code></pre>
<p>There should be no users with the same valid and preferred emails, so there is a unique index for that:</p>
<pre><code>db.users.createIndex( { &quot;emails.value&quot;: 1 }, { name: &quot;loginEmail&quot;, unique: true, partialFilterExpression: { &quot;emails.isValid&quot;: true, &quot;emails.isPreferred&quot;: true } } )
</code></pre>
<p>Adding the following email to the first document triggers the unique constraint violation:</p>
<pre><code>{
  name: &quot;John Doe&quot;,
  emails: [
   { 
     value: &quot;john.doe@gmail.com&quot;,
     isValid: false,
     isPreferred: false
   }
  ]
}
</code></pre>
<blockquote>
<p>Caused by: com.mongodb.MongoCommandException: Command failed with
error 11000 (DuplicateKey): 'E11000 duplicate key error collection:
profiles.users index: loginEmail dup key: { emails.value:
&quot;john.doe@gmail.com&quot;, emails.isValid: false, emails.isPreferred: false
}' on server profiles-db-mongodb.dev:27017. The full response is
{&quot;ok&quot;: 0.0, &quot;errmsg&quot;: &quot;E11000 duplicate key error collection:
profiles.users index: loginEmail dup key: { emails.value:
&quot;john.doe@gmail.com&quot;, emails.isValid: false, emails.isPreferred:
false }&quot;, &quot;code&quot;: 11000, &quot;codeName&quot;: &quot;DuplicateKey&quot;, &quot;keyPattern&quot;:
{&quot;emails.value&quot;: 1, &quot;emails.isValid&quot;: 1, &quot;emails.isPreferred&quot;: 1},
&quot;keyValue&quot;: {&quot;emails.value&quot;: &quot;john.doe@gmail.com&quot;, &quot;emails.isValid&quot;:
false, &quot;emails.isPreferred&quot;: false}}</p>
</blockquote>
<p>As I can understand, this happens because the filter expression is applied to the collection, not to the embedded documents, so although being somewhat counterintuitive and unexpected, the index behaves as described.</p>
<p>My question is how can I ensure partial uniqueness without having false negatives?</p>

