      &quot;bid&quot;: 1,
      &quot;type&quot;: &quot;C&quot;,
      &quot;name&quot;: &quot;N3&quot;
    }
  ],
  &quot;businesses&quot;: [
    {
      &quot;id&quot;: 1,
      &quot;contract_settings&quot;: {
        &quot;A&quot;: {
          &quot;price&quot;: 100
        },
        &quot;B&quot;: {
          &quot;price&quot;: 200
        },
        &quot;default&quot;: &quot;A&quot;
      }
    }
  ]
}
</code></pre>
<p>I want to find contract's price, according contract's type. If contract's type is not in contract_settings, then I should use default value.</p>
<p>For example for current scheme I expect output as</p>
<pre><code>  &quot;contracts&quot;: [
    {
      &quot;bid&quot;: 1,
      &quot;type&quot;: &quot;A&quot;,
      &quot;name&quot;: &quot;N1&quot;,
      &quot;price&quot;: 100
    },
    {
      &quot;bid&quot;: 1,
      &quot;type&quot;: &quot;B&quot;,
      &quot;name&quot;: &quot;N2&quot;,
      &quot;price&quot;: 200
    },
    {
      &quot;bid&quot;: 1,
      &quot;type&quot;: &quot;C&quot;,
      &quot;name&quot;: &quot;N3&quot;,
      &quot;price&quot;:100 // because default settings are settings for type &quot;A&quot;
    }
  ]
}
</code></pre>
<p>Contract_settings always has some types and 'default' always connected to existing type.</p>
<p>Is it possible to use field value ( contracts.type in scheme) as field name to get settings from businesses.contract_settings?</p>
<p>Note, that contract_settings can contains arbitrary names, so I can't use solution like this
<a href="https://stackoverflow.com/questions/34377286/mongodb-aggregation-project-field-values-as-fields">similar problem</a></p>
<p><a href="https://mongoplayground.net/p/aKAoLCPXQQA" rel="nofollow noreferrer">here is playground</a></p>
<p>PS. Same problem in postgres can be solved if contract_settings is jsonb field, and using code like this</p>
<pre><code>    ((CASE WHEN businesses.contract_settings::jsonb ? contracts.contract_type::text
            THEN businesses.contract_settings -&gt; contracts.contract_amount::text
            ELSE businesses.contract_settings -&gt; (businesses.contract_settings -&gt;&gt; 'default') END)-&gt;&gt;'price')::double precision
</code></pre>

