How to convert a list of objects with each object having an array of elements, to an array of objects with the subelement as a property<h3>Context</h3>
<ul>
<li>Node.js project with <a href="https://en.wikipedia.org/wiki/Mongoose_%28web_server%29" rel="nofollow noreferrer">Mongoose</a> and <a href="https://pugjs.org/api/getting-started.html" rel="nofollow noreferrer">Pug</a> as the templating engine</li>
</ul>
<p><strong>Example JSON content (fetched with Mongoose)</strong></p>
<pre><code>[
    {
        &quot;name&quot;: &quot;user1&quot;,
        &quot;blogs&quot;: [
            {
                &quot;title&quot;: &quot;blog1&quot;,
                &quot;created&quot;: &quot;01-01-2020&quot;
            },
            {
                &quot;title&quot;: &quot;blog2&quot;,
                &quot;created&quot;: &quot;01-01-2020&quot;
            }
        ]
    },
    {
        &quot;name&quot;: &quot;user2&quot;,
        &quot;blogs&quot;: [
            {
                &quot;title&quot;: &quot;blog3&quot;,
                &quot;created&quot;: &quot;01-01-2020&quot;
            },
            {
                &quot;title&quot;: &quot;blog4&quot;,
                &quot;created&quot;: &quot;01-01-2020&quot;
            }
        ]
    }
]

</code></pre>
<h3>Problem</h3>
<p>I'm trying to show a list of all blog posts, sorted by the creation date of the post and show the user that created it.</p>
<p>Injecting the above object in Pug and performing a <em>foreach</em> will group all performances by the user and makes it impossible to sort on the creation date of all performances (in thisobject form).</p>
<p>My solution would be the object to the following:</p>
<h3>Example JSON, mapping each blog entry to a user</h3>
<pre><code>[
    {
        &quot;name&quot;: &quot;user1&quot;,
        &quot;blog&quot;: {
            &quot;title&quot;: &quot;blog1&quot;,
            &quot;created&quot;: &quot;01-01-2020&quot;
        }
    },
    {
        &quot;name&quot;: &quot;user1&quot;,
        &quot;blog&quot;: {
            &quot;title&quot;: &quot;blog2&quot;,
            &quot;created&quot;: &quot;01-01-2020&quot;
        }
    },
    {
        &quot;name&quot;: &quot;user2&quot;,
        &quot;blog&quot;: {
            &quot;title&quot;: &quot;blog3&quot;,
            &quot;created&quot;: &quot;01-01-2020&quot;
        }
    },
    {
        &quot;name&quot;: &quot;user2&quot;,
        &quot;blog&quot;: {
            &quot;title&quot;: &quot;blog4&quot;,
            &quot;created&quot;: &quot;01-01-2020&quot;
        }
    }
]
</code></pre>
<p>This object form could make it possible to still display the data of the user with each blog entry and sort on the creation date of the performance.</p>
<p>I'm trying to achieve the latter, but I haven't found a clean way of doing it without <em>foreaching</em> or mapping.</p>
<h3>Note</h3>
<p>This problem could easily solved by defining a relationship and resolving the keys, but I'm explicitly trying to solve this problem with <a href="https://en.wikipedia.org/wiki/NoSQL" rel="nofollow noreferrer">NoSQL</a>.
Consequently, there is no reference of the user in the blog entity.</p>
<p>How would you solve this and what is the characteristic name of this particular operation?</p>

