Recursive function to remove null values from mongoose Object based on separate object<p>I'm building an API using nodejs, express and mongoDB through mongoose.  I would like to set things up so that when a PUT call is made to update a document, if <code>null</code> is passed for a field, that field is then removed, otherwise, whatever is passed will be saved.  I have been able to make this work fine as long as the documents have no subdocuments or arrays. It's when there are multiple levels within the data that I'm having trouble.</p>
<p>I found this recursive function that will remove all null values from an object and then return that updated object:</p>
<pre><code>const removeEmpty = (obj) =&gt; {
  Object.keys(obj).forEach(key =&gt;
    (obj[key] &amp;&amp; typeof obj[key] === 'object') &amp;&amp; removeEmpty(obj[key]) ||
    (obj[key] === undefined || obj[key] === null) &amp;&amp; delete obj[key]
  );
  return obj;
};
</code></pre>
<p>However, this only works for removing properties of the same object.  What I need to be able to do is run this function on one object, while removing the correct corresponding properties on the other object. And I don't even know where to begin with that, unfortunately.  My head already starts to spin a bit just with a simple recursive function like the one above.</p>
<p>I've tried to first update the mongoose object returned from a find by comparing it to the data passed in the API call, and then running that updated mongoose object through the <code>removeEmpty</code> function above. But mongoose ignores any null or empty string properties passed, and any mongoose object I try to run though the same function always results in a &quot;Maximum call stack size exceeded&quot; error.</p>
<p>Ideally, I'd like a universal function that I can pass all update call data to the API through, but I'm open to just about any solution at this point.</p>
